});
const db = mongoose.connection;
const handleOpen = () => {
  console.log("Connect to MongoDB");
};
const handleError = error => {
  console.log(`Error on DB Connection: ${error}`);
};
db.once("open", handleOpen);
db.on("error", handleError);

